import React, { Component } from "react";
import MenuItem from "../navbar/verticalnavbar/menuitem";

class ListMenu extends Component {
  render() {
    return (
      <div
        className="row"
        style={{
          marginLeft: "20px",
          marginTop: "30px"
        }}
      >
        <div className="col-xs-7 col-sm-6 col-lg-8">
          <div className="card">
            <div className="card-body">
              <h5
                className="card-title font-weight-bold"
                style={{
                  fontSize: "12px",
                  float: "left",
                  fontStyle: "bolt",
                  color: "#636e72"
                }}
              >
                CHOOSE ROBOT TYPE
              </h5>
              <div className="row">
                <MenuItem iconType="layer-group" buttonCaption={this.p}/>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ListMenu;
